pragma solidity ^0.8.0;

contract modificadores{
    uint supply = 10;
    address admin = msg.sender;

    function getSupply() external view returns (uint){
        return supply;
    }

    function mint(uint _valor) external onlyAdmin(){
        supply += _valor;
    }

    modifier onlyAdmin(){
        require(msg.sender == admin, "Nao e o Admin");
        _;
    }

}

